import React from 'react'
import logo from "..Logo.svg"
import { Link } from 'react-router-dom'

const Navbar = () => {
  return (
    <div>
      <Link>
          <img src={logo} alt=''/>
      </Link>
    </div>
  )
}

export default Navbar
